import "bootstrap/dist/css/bootstrap.min.css";
import styled from "styled-components";

import { Button, Navbar, Container, Nav, Row, Col } from "react-bootstrap";

let Title = styled.div`
  font-size: 2rem;
  padding: 0.5rem;
  text-align: center;
`;

const CircleButtonBlock = styled.div`
  width: 3.5rem;
  height: 3.5rem;
  background: white;
  border-radius: 100%;
  background: rgb(152, 169, 255);
  background: radial-gradient(
    circle,
    rgba(152, 169, 255, 0.9055555555555556) 0%,
    rgba(67, 113, 255, 1) 100%
  );
  box-shadow: 19px 19px 38px #9096a0, -19px -19px 38px #ffffff;
  overflow: hidden;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
`;
const Icon = styled.div`
  color: #fff;
  font-size: 2.5rem;
  background: none;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
`;
const InButton = styled.div`
  position: relative;
  background: #none;
  object-fit: cover;
  border-radius: 100rem;
  width: 100%;
  height: 100%;
  box-shadow: 0 0 6px 2px #fff;
`;

function App() {
  return (
    <div className="App">
      <Navbar className="bg-body-tertiary">
        <Container>
          <Navbar.Brand href="#home">Music SNS</Navbar.Brand>
        </Container>
      </Navbar>
      <Title>메인 페이지</Title>
      <CircleButtonBlock>
        {" "}
        <InButton>
          <Icon>></Icon>
        </InButton>
      </CircleButtonBlock>
    </div>
  );
}

export default App;
